async () => {
  await CriarProjetoAPI.run({
    projetoDados: {
      'titulo': Input1.text,
      'contrato': Input2.text,
      'num_sap': Input3.text,
      'id_coordenador': Input4.text,
      'id_proponente': Input5.text
    }
  }).catch(() => {
    showAlert("Erro ao criar projeto");
    return false;
  });
  return true;
}

